INSERT INTO `artista` VALUES (4,'Ensiferum','&lt;h3&gt;Finlandia    \r\n    (1995 ÃÂÃÂ¢ÃÂÃÂÃÂÃÂ presente)&lt;&#x2F;h3&gt;&lt;p&gt;\r\n Ensiferum es un grupo de &lt;a href=&quot;http:&#x2F;&#x2F;www.lastfm.es&#x2F;tag&#x2F;viking%20metal&quot;&gt;viking metal&lt;&#x2F;a&gt;, procedente de Finlandia.&lt;br&gt;\r\n&lt;br&gt;\r\nAllÃÂÃÂÃÂÃÂ¡ por el 1995 Markus Toivonen (Guitarra) tocaba con unos amigos en \r\nuna banda llamada ÃÂÃÂÃÂÃÂ«Black ReflectionsÃÂÃÂÃÂÃÂ» y se dedicaban a tocar canciones \r\nde grupos de thrash como &lt;a href=&quot;http:&#x2F;&#x2F;www.lastfm.es&#x2F;music&#x2F;Megadeth&quot;&gt;Megadeth&lt;&#x2F;a&gt;, &lt;a href=&quot;http:&#x2F;&#x2F;www.lastfm.es&#x2F;music&#x2F;Pantera&quot;&gt;Pantera&lt;&#x2F;a&gt; y otros. Markus se dio cuenta de que esa banda no le ofrecÃÂÃÂÃÂÃÂ­a mucha libertad para tocar la mÃÂÃÂÃÂÃÂºsica que ÃÂÃÂÃÂÃÂ©l querÃÂÃÂÃÂÃÂ­a, algo diferente.\r\n  A ÃÂÃÂÃÂÃÂ©l le encantaba el &lt;a href=&quot;http:&#x2F;&#x2F;www.lastfm.es&#x2F;tag&#x2F;folk&quot;&gt;folk&lt;&#x2F;a&gt;, y se sentÃÂÃÂÃÂÃÂ­a tremendamente atraÃÂÃÂÃÂÃÂ­do por bandas de &lt;a href=&quot;http:&#x2F;&#x2F;www.lastfm.es&#x2F;tag&#x2F;death%20metal&quot;&gt;death metal&lt;&#x2F;a&gt; MelÃÂÃÂÃÂÃÂ³dico como &lt;a href=&quot;http:&#x2F;&#x2F;www.lastfm.es&#x2F;music&#x2F;Amorphis&quot;&gt;Amorphis&lt;&#x2F;a&gt; o &lt;a href=&quot;http:&#x2F;&#x2F;www.lastfm.es&#x2F;music&#x2F;+noredirect&#x2F;Dark+Tranquility&quot;&gt;Dark Tranquility&lt;&#x2F;a&gt;,\r\n y un buen dÃÂÃÂÃÂÃÂ­a decidiÃÂÃÂÃÂÃÂ³ hablar con su amigo Kimmo Miettinen (BaterÃÂÃÂÃÂÃÂ­a del \r\ngrupo) y le propuso de tocar un folk-heroic-death-melodic Metal (mÃÂÃÂÃÂÃÂ¡s \r\ntarde llamado solo &lt;a href=&quot;http:&#x2F;&#x2F;www.lastfm.es&#x2F;tag&#x2F;viking%20metal&quot;&gt;viking metal&lt;&#x2F;a&gt;),\r\n y este aceptÃÂÃÂÃÂÃÂ³. tambiÃÂÃÂÃÂÃÂ©n recogieron por el camino a otro de sus amigos, \r\nSauli Savolainen (Bajo), y con el ya tenÃÂÃÂÃÂÃÂ­an el grupo, pero no el nombre,\r\n problema que Markus solucionÃÂÃÂÃÂÃÂ³ con la ayuda de un diccionario. Un dÃÂÃÂÃÂÃÂ­a, \r\nojeando un libro de latÃÂÃÂÃÂÃÂ­n, Markus se fijÃÂÃÂÃÂÃÂ³ en una palabra, Ensiferum, que\r\n significa ÃÂÃÂÃÂÃÂ«portador de espadaÃÂÃÂÃÂÃÂ», o guerrero para ser mÃÂÃÂÃÂÃÂ¡s exactos, algo \r\nque incitÃÂÃÂÃÂÃÂ³ a Markus a poner tal nombre al grupo.&lt;br&gt;\r\n&lt;br&gt;\r\nDurante el aÃÂÃÂÃÂÃÂ±o 1996 Markus se dedicÃÂÃÂÃÂÃÂ³ a componer las primeras canciones \r\ndel grupo, Knighthood, Old Man y Frost. MÃÂÃÂÃÂÃÂ¡s tarde ese mismo aÃÂÃÂÃÂÃÂ±o \r\nacogieron en sus filas al guitarrista Jari MÃÂÃÂÃÂÃÂ¤enpÃÂÃÂÃÂÃÂ¤ÃÂÃÂÃÂÃÂ¤ para ayudar a Markus \r\ncon las voces y los increÃÂÃÂÃÂÃÂ­bles solos que este joven era capaz de \r\nrealizar.\r\n  &lt;&#x2F;p&gt;','data:image/png;base64,'),(5,'Bill Fay','&amp;lt;p&amp;gt;Bill Fay es un cantautor de folk rock y pop psicod&Atilde;&copy;lico que desarroll&Atilde;&sup3; \r\nsu carrera a finales de los a&Atilde;&plusmn;os 60 y comienzos de los 70. Su m&Atilde;&ordm;sica \r\nest&Atilde;&iexcl; fuertemente influida por &amp;lt;a href=&amp;quot;http:&amp;#x2F;&amp;#x2F;www.lastfm.es&amp;#x2F;music&amp;#x2F;Bob+Dylan&amp;quot;&amp;gt;Bob Dylan&amp;lt;&amp;#x2F;a&amp;gt; y se asemeja a la de otros artistas como &amp;lt;a href=&amp;quot;http:&amp;#x2F;&amp;#x2F;www.lastfm.es&amp;#x2F;music&amp;#x2F;Al+Stewart&amp;quot;&amp;gt;Al Stewart&amp;lt;&amp;#x2F;a&amp;gt;, &amp;lt;a href=&amp;quot;http:&amp;#x2F;&amp;#x2F;www.lastfm.es&amp;#x2F;music&amp;#x2F;Donovan&amp;quot;&amp;gt;Donovan&amp;lt;&amp;#x2F;a&amp;gt; o &amp;lt;a href=&amp;quot;http:&amp;#x2F;&amp;#x2F;www.lastfm.es&amp;#x2F;music&amp;#x2F;Nick+Drake&amp;quot;&amp;gt;Nick Drake&amp;lt;&amp;#x2F;a&amp;gt;.&amp;lt;br&amp;gt;\r\n&amp;lt;br&amp;gt;\r\nDebut&Atilde;&sup3; en 1967 con el single &Acirc;&laquo;Some Good Advice&Acirc;&raquo;&amp;#x2F;&Acirc;&raquo;Screams in the Ears&Acirc;&raquo; \r\nproducido por el co-manager de Donovan Peter Eden. Sin embargo no fue \r\nhasta 1971 cuando se public&Atilde;&sup3; su primer LP titulado simplemente &Acirc;&laquo;Bill \r\nFay&Acirc;&raquo;. El &Atilde;&iexcl;lbum se caracterizaba por la influencia del Bob Dylan de \r\n&Acirc;&laquo;Blonde on Blonde&Acirc;&raquo; en las letras y por los barrocos arreglos \r\norquestales.&amp;lt;&amp;#x2F;p&amp;gt;','data:image/jpeg;base64,'),(6,'Battles','&lt;p&gt;Battles es una banda de &lt;a href=&quot;http:&#x2F;&#x2F;www.lastfm.es&#x2F;tag&#x2F;math%20rock&quot;&gt;math rock&lt;&#x2F;a&gt; estadounidense. DespuÃÂÃÂ©s de una serie de EPÃÂ¢ÃÂÃÂs la banda lanzÃÂÃÂ³ su primer LP en la discogrÃÂÃÂ¡fica &lt;a href=&quot;http:&#x2F;&#x2F;www.lastfm.es&#x2F;label&#x2F;Warp+Records&quot;&gt;Warp Records&lt;&#x2F;a&gt; en mayo de 2007. El grupo estÃÂÃÂ¡ compuesto por mÃÂÃÂºsicos bastante conocidos, incluyendo al bateria John Stanier ex-&lt;a href=&quot;http:&#x2F;&#x2F;www.lastfm.es&#x2F;music&#x2F;Helmet&quot;&gt;Helmet&lt;&#x2F;a&gt; (actualmente en &lt;a href=&quot;http:&#x2F;&#x2F;www.lastfm.es&#x2F;music&#x2F;Tomahawk&quot;&gt;Tomahawk&lt;&#x2F;a&gt;) y al guitarrista Ian Williams (ex-&lt;a href=&quot;http:&#x2F;&#x2F;www.lastfm.es&#x2F;music&#x2F;Don+Caballero&quot;&gt;Don Caballero&lt;&#x2F;a&gt;, ex-Storm &amp;amp; Stress), al guitarrista ex-&lt;a href=&quot;http:&#x2F;&#x2F;www.lastfm.es&#x2F;music&#x2F;Lynx&quot;&gt;Lynx&lt;&#x2F;a&gt; Dave Konopka.&lt;br&gt;\r\n&lt;br&gt;\r\nSu album reciente &lt;a href=&quot;http:&#x2F;&#x2F;www.lastfm.es&#x2F;music&#x2F;Battles&#x2F;Mirrored&quot;&gt;Mirrored&lt;&#x2F;a&gt;,\r\n grabado por Keith Souza en Machines With Magnets, vio la luz el 14 de \r\nmayo de 2007. El primer sencillo del album, ÃÂÃÂ«AtlasÃÂÃÂ», saliÃÂÃÂ³ como un \r\nstreaming de radio el 21 de febrero de 2007 y su video fue sacado el 28 \r\nde febrero de 2007.\r\n  &lt;br&gt;&lt;br&gt; Recientemente el sencillo ÃÂÃÂ«AtlasÃÂÃÂ» fue votado \r\ncomo ÃÂÃÂ«mejor sencillo de la semanaÃÂÃÂ» por la revista NME Magazine y recibiÃÂÃÂ³\r\n una excelente crÃÂÃÂ­tica en la revista britÃÂÃÂ¡nica Clash Magazine, donde se \r\ncompara con &lt;a href=&quot;http:&#x2F;&#x2F;www.lastfm.es&#x2F;music&#x2F;Glitter+Beat&quot;&gt;Glitter Beat&lt;&#x2F;a&gt;.&lt;br&gt;\r\n&lt;br&gt;\r\n&lt;a href=&quot;http:&#x2F;&#x2F;www.lastfm.es&#x2F;music&#x2F;Anthony+Braxton&quot;&gt;Anthony Braxton&lt;&#x2F;a&gt;) dejÃÂÃÂ³ la banda en agosto de 2010 para continuar con sus proyectos personales&lt;&#x2F;p&gt;','data:image/png;base64,'),(7,'Pink Floyd','',''),(8,'Nightwish','',''),(9,'Iron Maiden','FUCKIGN!!!!','data:image/jpeg;base64,'),(10,'Less Than Jake','',''),(11,'La Habitación Roja','',''),(12,'Sin Bandera','',''),(13,'WhoCares','',''),(14,'Black Sabbath','','data:image/jpeg;base64,'),(15,'Paramore','',''),(16,'Amon Amarth','',''),(17,'Sublime With Rome','',''),(18,'GusGus','',''),(19,'Gorillaz','','');
