INSERT INTO `genero` VALUES (6,'Viking metal','',''),(7,'Folk Psych','',''),(8,'None','',''),(9,'Rock','',''),(10,'Metal','',''),(11,'Heavy Metal','&amp;lt;p&amp;gt;El heavy metal (literalmente en espa&Atilde;&plusmn;ol metal pesado) es un g&Atilde;&copy;nero \r\nmusical evolucionado a partir del rock and roll y el hard rock \r\ncaracterizado por ritmos potentes logrados mediante la utilizaci&Atilde;&sup3;n de \r\nguitarras distorsionadas, bater&Atilde;&shy;as con doble bombo o doble pedal, y \r\nbajos pronunciados.&amp;lt;br&amp;gt;\r\n&amp;lt;br&amp;gt;\r\nEl t&Atilde;&copy;rmino heavy metal, debido a la progresi&Atilde;&sup3;n que ha sufrido este \r\ng&Atilde;&copy;nero desde su creaci&Atilde;&sup3;n, se usa actualmente para hacer referencia a dos\r\n conceptos distintos: heavy metal como g&Atilde;&copy;nero musical (tambi&Atilde;&copy;n llamado \r\nmetal) y heavy metal cl&Atilde;&iexcl;sico como subg&Atilde;&copy;nero musical tradicional dentro \r\nde dicho g&Atilde;&copy;nero&amp;lt;&amp;#x2F;p&amp;gt;',''),(12,'Ska-Punk','',''),(13,'Latin','',''),(14,'Other','',''),(15,'Ska','',''),(16,'Hard Rock','',''),(17,'www.mp3-ogg.ru','',''),(18,'Pop Rock','',''),(19,'Death Metal','',''),(20,'Melodic Death Metal','',''),(21,'Doom Jazz','',''),(22,'Trance','',''),(23,'Tri-Hop','','');
/*!40000 ALTER TABLE `genero` ENABLE KEYS */;
